import { useEffect, useState } from "react";

export default function App() {
  const [isLoading, setIsLoading] = useState(true);
  const [text, setText] = useState([]);

  useEffect(() => {
    fetch("http://localhost:3001/orders")
      .then((res) => res.json())
      .then((data) => {
		console.log(data)
		//JSON.stringify(data)
        //console.log(data)
		setText(data)
		console.log(data)
        //setIsLoading(false);
      })
	  .catch((error) => {
		console.log('Hubo un problema con la petición Fetch:' + error.message);
	  })
  }, []);

  /*if (isLoading) {
    return (
      <div className="App">
        <h1>Cargando...</h1>
      </div>
    );
  }*/

  return (
	<div>
		
			{text.map((element) => {
				return (
					
						<div className="card">
							<table className="table table-bordered">
								<tr><td>{element.time}</td></tr>
								<tr><td>{element.quantity}</td></tr>
								<tr><td>{element.totalPrice}</td></tr>
							</table>
						</div>
					
				)
			})}

	</div>
  );
}
